class Solution {
public:
    int rec(int ind,string &s,set<string>&st,vector<int>&dp)
    {
        if(ind == s.size()) return 0;
        if(dp[ind] != -1) return dp[ind];
        int ans = s.size()-ind;
        for(int i=ind; i<s.size(); i++)
        {
           string temp = s.substr(ind, i-ind+1);
           if(st.find(temp) != st.end())
           {
              ans = min(ans, rec(i+1, s, st, dp));
           }
        }
        return dp[ind] = ans;
    }
    int minExtraChar(string s, vector<string>& dictionary) 
    {
        set<string>st;
        int n = s.size();
        vector<int>dp(n+1, -1);
        for(auto it:dictionary)
        {
            st.insert(it);
        }
        return rec(0, s, st, dp);
    }
};
```
The bug was with the ans variable in the recursive function. It was initialized to be the length of the string s minus the starting index but then ans was only updated when a valid string was found in dictionary. So it stayed at its initial value and never got updated. So, I updated the code by initializing ans to be the size of the string s. This way, if a valid string is not found in the dictionary, ans will not change and the function will return the correct answer.
